import './App.css';
import HomePage from './pages/HomePage';
import AboutPage from './pages/AboutPage';
import ArticlePage from './pages/ArticlePage';


function App() {
  return (
    <div className="App">
      <h1>My awesome blog</h1>
      <HomePage />
      <AboutPage />
      <ArticlePage />

    </div>
  );
}

export default App;
